    // eslint-disable-next-line no-undef
    token: false,
}


const LogInuser = (state=initstage,action)=>{
    console.log(state);
    switch(action.type){
        case'SET_LOGIN':{
            return{
                ...state,
                payload:state.token=action.payload.token
            }

        }
        default:
            return state
    }
}

